INSERT INTO `doc` VALUES (2,'configuracoes-limite-total','Limite Total','<p>Limite total de boregkneosgnoseg</p>\r\n','2023-04-13 16:55:52','2023-04-13 16:55:52'),(3,'campos-title','Título','<p>Nome do campo</p>\r\n','2023-05-06 14:21:26',NULL),(4,'campos-pos','Posição','<p>Posição da listagem que vai aparecer esse campo</p>\r\n','2023-05-06 14:22:14',NULL),(5,'campos-ref','Referência','<p>Esse campo define qual é a referência desse campo:<br />\n<strong>Atividades</strong> = Aba 6<br />\n<strong>Exame</strong> = Aba 5<br />\n<strong>PCMSO</strong> = Aba 4</p>\n','2023-05-06 14:23:21','2023-05-06 14:24:29'),(6,'campos-anexo','Ativar Anexo','<p>Esse campo define se ao marcar esse campo vai aparecer o botão de anexar PCMSO.</p>\r\n','2023-05-06 14:26:52',NULL),(7,'configuracao-financeiro-email-de-confirmacao','Confirmação de Pagamento','<p>Defina qual email será enviado quando o pagamento do formulário de guia de encaminhamento for confirmado.</p>\n<p>Esse email é usado apenas para Balcão</p>','2023-05-06 23:17:49','2023-05-06 23:17:49'),(8,'configuracao-financeiro-email-de-recusado','Cartão Recusado','<p>Selecione o email que será enviado quando o pagamento do formulário de guia de encaminhamento for cartão de crédito, recusado.</p>\r\n','2023-05-06 23:18:26','2023-05-06 23:19:01'),(9,'configuracao-total-notificacoes','Total de Notificações','<p>Selecione a quantidade de notificações que será enviada para o email do colaborador caso o estado do pagamento esteja pendente.</p>\r\n','2023-05-06 23:19:55','2023-05-06 23:19:55'),(10,'configuracao-gn-ambiente','Ambiente','<p>Selecione o ambiente da aplicação da API do GerenciaNET.</p>\r\n\r\n<p><strong>Produção</strong> = Ambiente real, com dinheiro real.<br />\r\n<strong>Homologação</strong> = Ambiente de Testes, dinheiro fictício.</p>\r\n','2023-05-07 12:14:19','2023-05-07 12:14:41'),(11,'configuracao-gn-client-id','Client ID','<p>Selecione a <strong>Chave Client ID</strong> fornecido pelo GerenciaNet ao criar uma aplica&ccedil;&atilde;o.</p>\n\n<p><a href=\"https://app.sejaefi.com.br/api/aplicacoes\" target=\"_blank\">Clique aqui</a> para criar uma aplica&ccedil;&atilde;o.</p>\n\n<h3 dir=\"auto\"><strong>Crie uma nova aplica&ccedil;&atilde;o para usar a API Gerencianet:</strong></h3>\n\n<p>1. Acesse o painel da Gerencianet no menu <strong>API</strong>.<br />\n2. No menu lateral, clique em <strong>Aplica&ccedil;&otilde;es</strong> depois em <strong>Criar aplica&ccedil;&atilde;o</strong>.<br />\n3. Insira um nome para a aplica&ccedil;&atilde;o, e selecione qual API quer ativar: <strong>API de emiss&otilde;es</strong> (boletos e carn&ecirc;s) e/ou <strong>API Pix</strong> e/ou Pagamentos. Neste caso, API Pix;que estes podem ser alterados posteriormente).<br />\n4. selecione os Escopos de Produ&ccedil;&atilde;o e Escopos de Homologa&ccedil;&atilde;o (Desenvolvimento) que deseja liberar;<br />\n5. Clique em <strong>Criar aplica&ccedil;&atilde;o</strong>.</p>\n\n<p>Informe a sua Assinatura Eletr&ocirc;nica para confirmar as altera&ccedil;&otilde;es e atualizar a aplica&ccedil;&atilde;o.</p>\n','2023-05-07 12:16:25','2023-05-07 12:16:55'),(12,'configuracao-gn-client-secret','Client Secret','<p>Selecione a <strong>Chave Client Secret</strong> fornecido pelo GerenciaNet ao criar uma aplica&ccedil;&atilde;o.</p>\n\n<p><a href=\"https://app.sejaefi.com.br/api/aplicacoes\" target=\"_blank\">Clique aqui</a> para criar uma aplica&ccedil;&atilde;o.</p>\n\n<h3 dir=\"auto\"><strong>Crie uma nova aplica&ccedil;&atilde;o para usar a API Gerencianet:</strong></h3>\n\n<p>1. Acesse o painel da Gerencianet no menu <strong>API</strong>.<br />\n2. No menu lateral, clique em <strong>Aplica&ccedil;&otilde;es</strong> depois em <strong>Criar aplica&ccedil;&atilde;o</strong>.<br />\n3. Insira um nome para a aplica&ccedil;&atilde;o, e selecione qual API quer ativar: <strong>API de emiss&otilde;es</strong> (boletos e carn&ecirc;s) e/ou <strong>API Pix</strong> e/ou Pagamentos. Neste caso, API Pix;que estes podem ser alterados posteriormente).<br />\n4. selecione os Escopos de Produ&ccedil;&atilde;o e Escopos de Homologa&ccedil;&atilde;o (Desenvolvimento) que deseja liberar;<br />\n5. Clique em <strong>Criar aplica&ccedil;&atilde;o</strong>.</p>\n\n<p>Informe a sua Assinatura Eletr&ocirc;nica para confirmar as altera&ccedil;&otilde;es e atualizar a aplica&ccedil;&atilde;o.</p>\n','2023-05-07 12:17:29','2023-05-07 12:17:29'),(13,'configuracao-gn-chave-pix','Chave PIX','<p>Esse campo é necessário para gerar o PIX do módulo financeiro, defina a chave da sua conta.<br />\r\n<a href=\"https://app.sejaefi.com.br/pix/minhas-chaves\" target=\"_blank\">Clique aqui</a> para gerar ou copiar uma chave da sua conta GerenciaNet.</p>\r\n','2023-05-07 12:31:27','2023-05-07 12:31:27'),(14,'configuracao-gn-certificado','Enviar Certificado PIX','<p>Esse campo é necessário para gerar o PIX do módulo financeiro, Envie o certificado .p12 fornecido pela sua conta GerenciaNet.<br />\n<a href=\"https://app.sejaefi.com.br/api/meus-certificados\" target=\"_blank\">Clique aqui</a> para gerar um certificado digital da sua conta GerenciaNet.</p>\n\n<p dir=\"auto\"><strong>Para gerar seu certificado:</strong></p>\n\n<p style=\"text-align:justify\">1. Acesse o painel da Gerencianet no menu <strong>API</strong>.<br />\n2. No menu lateral, clique em <strong>Meus Certificados</strong> e escolha o ambiente em que deseja o certificado: <strong>Produção</strong> ou <strong>Homologação</strong>.<br />\n3. Clique em <strong>Criar Certificado</strong>.<br />\n4. Insira sua Assinatura Eletrônica para confirmar a alteração.</p>\n','2023-05-07 12:33:08','2023-05-10 22:12:36'),(15,'configuracao-financeiro-email-de-notificacao','Email da Notificação','<p>Esse campo define qual é o email que será enviado nesse tipo de notificação.</p>\r\n','2023-05-07 12:36:11','2023-05-07 12:36:11'),(16,'configuracao-financeiro-intervalo-de-notificacao','Intervalo','<p>Esse campo define qual será o intervalo que será enviado o email, baseado no horário que o usuário fez o cadastro no formulário de Guia de Encaminhamento.</p>\r\n\r\n<p><em><strong>Detalhe: A notificação só é enviada caso o pagamento não seja confirmado no Interval e Período estabelecido.</strong></em></p>\r\n','2023-05-07 12:37:40','2023-05-07 12:39:27'),(17,'configuracao-financeiro-periodo-de-notificacao','Período','<p>Esse campo define qual será o Período que será enviado o email, baseado no horário que o usuário fez o cadastro no formulário de Guia de Encaminhamento.<br />\r\nEx: Intervalo 30, e Período Minutos, será enviado um email 30 minutos após o cadastro do formulário.<br />\r\n<em><strong>Detalhe: A notificação só é enviada caso o pagamento não seja confirmado no Interval e Período estabelecido.</strong></em></p>\r\n','2023-05-07 12:39:22','2023-05-07 12:39:22'),(18,'configuracao-gn-id-conta','Identificador de Conta','<p>Esse campo é necessário para efetuar o pagamento via Cartão de Crédito.</p>\r\n\r\n<p><strong>Como obter o Identificador de Conta:</strong></p>\r\n\r\n<ul>\r\n	<li><a href=\"https://usuario.gerencianet.com.br/login\" target=\"_blank\">Efetue login</a> em sua conta Efí e acesse <code>API</code> (Lateral a esquerda)</li>\r\n	<li>Acesse o menu API, e copie seu <code>Identificador de Conta</code> (<a href=\"https://s3.amazonaws.com/gerencianet-pub-prod-1/printscreen/2023/03/08/matheus.rodrigues/24fa15-dda30019-a643-409e-8813-c7cc68adcc40.png\" target=\"_blank\">veja onde</a>)</li>\r\n</ul>\r\n','2023-05-15 18:12:25','2023-05-15 18:13:51'),(19,'configuracao-financeiro-email-de-atendimento','Confirmação de Atendimento','<p>Defina qual email será enviado quando o formulário de guia de encaminhamento for confirmado.</p>\n<p>Esse email é usado apenas para Mensalistas</p>\n','2023-05-06 23:17:49','2023-05-06 23:17:49'),(20,'variaveis-feriado','Data Feriado','<p>Esse campo define uma data de um feriado, permitindo ocultar essa data no agendamento de exames.</p>\r\n','2023-06-05 20:21:24','2023-06-05 20:21:24'),(21,'agenda_ativar_dia_0','Domingo','<p>Ativar os dias de Domingo no agendamento de exames.</p>\r\n','2023-06-05 20:31:51','2023-06-05 20:31:51'),(22,'agenda_ativar_dia_1','Segunda','<p>Ativar os dias de Segunda-Feira no agendamento de exames.</p>\r\n','2023-06-05 20:31:51','2023-06-05 20:31:51'),(23,'agenda_ativar_dia_2','Terça','<p>Ativar os dias de Terça-Feira no agendamento de exames.</p>\r\n','2023-06-05 20:31:51','2023-06-05 20:31:51'),(24,'agenda_ativar_dia_3','Quarta','<p>Ativar os dias de Quarta-Feira no agendamento de exames.</p>\r\n','2023-06-05 20:31:51','2023-06-05 20:31:51'),(25,'agenda_ativar_dia_4','Quinta','<p>Ativar os dias de Quinta-Feira no agendamento de exames.</p>\r\n','2023-06-05 20:31:51','2023-06-05 20:31:51'),(26,'agenda_ativar_dia_5','Sexta','<p>Ativar os dias de Sexta-Feira no agendamento de exames.</p>\r\n','2023-06-05 20:31:51','2023-06-05 20:31:51'),(27,'agenda_ativar_dia_6','Sábado','<p>Ativar os dias de Sábado no agendamento de exames.</p>\r\n','2023-06-05 20:31:51','2023-06-05 20:31:51'),(34,'campos-motorista-salario','Salário Padrão','Esse campo define qual é o salário padrão que será preenchido ao cadastrar um novo motorista.<br>','2023-06-05 20:39:31','2023-06-05 20:39:31'),(35,'campos-comissao-por-pacote','Comissão por Pacote','Esse campo define se vai ser ativado a função de gerar comissões para motoristas.<br>\n<strong>Se ativado</strong>, baseado nas <a href=\"/SGS/configuracoes/comissoes\" target=\"_blank\">Comissões</a> será calculado a porcentagem de taxa de sucesso do roteiro e vai gerar os valores das comissões no salário do Motorista.\n','2023-06-05 20:39:31','2023-06-05 20:39:31'),(36,'campos-motorista-dia-salario','Dia Salário Padrão','Esse campo define qual é o dia de pagamento padrão que será preenchido ao cadastrar um novo motorista.<br>','2023-06-05 20:39:31','2023-06-05 20:39:31');
