INSERT INTO `videos` VALUES (1,1,1,1,'Eu, a Patroa e as Crianças | 2ª Temporada Completa - VITOR KEVIN TV','<p>Eu, a Patroa e as Crianças 2ª Temporada Completa (VITOR KEVIN TV) Se inscreva no canal, deixe o like e ative o sininho que ainda tem muita novidade pela frente. Vitor Kevin é um cantor, compositor e multi-instrumentista brasileiro de rock cristão. Se tem uma forma de definir esse trabalho, posso dizer que é alguém que ama Jesus de todo coração e tem se dedicado a levar as experiências que teve com Deus através da música. Aqui nesse canal você poderá conhecer mais sobre meu trabalho musical, além de poder assistir a filmes, séries e curtas metragens exclusivos e outros materiais inéditos que você só encontra aqui, então inscreva-se, deixe seu like e ative o sininho. Obrigado pelo apoio, que Deus abençoe sua vida! Paz (VITOR KEVIN)</p>','Eu, a Patroa e as Crianças | 2ª Temporada Completa','https://www.youtube.com/watch?v=ZIsq7WWTu7s','9f316c066536a9cc8dc870e6323fdfe6.jpg','2024-02-14 18:28:09',NULL,NULL),(2,1,1,1,'O DIA que o MANO DEYVIN falou BOSTA!','<p>https://www.youtube.com/watch?v=ypoZxu7RYFE</p>','O DIA que o MANO DEYVIN falou BOSTA!','https://www.youtube.com/watch?v=ypoZxu7RYFE','6ade52de9ba1ab553c06d2246646b25f.jpg','2024-02-15 19:53:15',NULL,NULL);
